@JustinGlynSJ @KateManchester4 @lucyandlil @tonykevin @MScharnke Of course, a UN investigation bid by the RF (supported by China at the SC) was vetoed.

The most compelling evidence, for mine, were all the blood tests from autopsies, POW's, people who crossed to the RF.

Put simply, the Ukrainians were treated as 'lab rats'.
